import React, {useState} from 'react';
import { useNavigate } from 'react-router-dom';

export default function VolunteerLogin(){
    const demoEmail = 'abc@gmail.com'
    const demoPassword = 'abc'
    const [error, setError] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();

    const handleVolRegister = (event) => {
        navigate('/volregister')
    }

    const handleAdminRegister = (event) => {
        navigate('/adminregister')
    }

    const handleAdminLogin = (event) => {
        navigate('/adminlogin')
    }

    const handleSubmit = (event) => {
        event.preventDefault();
        if(email === demoEmail && password === demoPassword){
            setError('');
            navigate('/volhome');
        }
        else{
            setError('Invalid email or password')
        }
    }
    return(
        <div style={{border: '2px solid black', textAlign: 'center', display: 'flex', alignSelf: 'center'}}>
            <div className='form-div'>

            <form onSubmit={handleSubmit}>
                <div><h1>Volunteer Log In Here</h1>
                <hr />
                </div>
                <label>
                <p>Email</p>
                <input type="text" onChange={e => setEmail(e.target.value)} />
                </label>
                <label>
                <p>Password</p>
                <input type="password" onChange={e => setPassword(e.target.value)} />
                </label>
                <div>
                <div><button type="submit">Submit</button></div>
                <br/>
                <div><button onClick={handleVolRegister}>Volunteer Registration</button></div>  
                <br />
                <div><button onClick={handleAdminLogin}>Admin Login</button></div>
                <br />
                <div><button onClick={handleAdminRegister}>Admin Registration</button></div>
                </div>
                {error && <div>{error}</div>}
            </form>
            </div>
        </div>
    );
}
